    <style>
        body {
            margin: 0 auto;

        hr {
            width: 80%;
        }

        .container {
            width: 100vw;
            height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
            gap: 10px;
            flex-direction: column;
        }

        .image {
            object-fit: contain;
            width: 250px;
            padding: 50px;
            box-sizing: border-box;
        }

        @keyframes rolling {
            0% {
                transform: rotate3d(1, 1, 1, 0deg);
            }

            100% {
                transform: rotate3d(1, 1, 1, 360deg);
            }
        }

        #targetImage {
            animation: rolling 3s linear 0s infinite normal none;
            perspective: 500px;
            backface-visibility: visible;
        }

        #ParentElement {
            perspective: 500px;
            perspective-origin: center;
        }
    </style>
